import React from "react";
import "./Main_Top.css";

function Main_Top() {
  return (
    <div
      className="main-top"
      style={{
     backgroundImage: "url('/about-banner.png')",
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        height: '640px', 
        width: '100%',
        display: 'flex',
      }}
    >
        <img className="title" src="/about-banner-title.png"></img>
    </div>
  );
}

export default Main_Top;
